import React from 'react';
import RecipeCard from './RecipeCard';

const RecipeList = ({ recipes, onRecipeClick, error }) => {
  if (error) {
    return <p>{error}</p>;
  }

  if (!recipes || recipes.length === 0) {
    return ;
  }

  return (
    <div>
      <ul>
        {recipes.map((recipe) => (
          <RecipeCard 
          key={recipe.id} 
          recipe={recipe} 
          onRecipeClick={onRecipeClick} 
        />
        ))}
      </ul>
    </div>
  );
};

export default RecipeList;
